import React from 'react';
import './AmenitiesPopup.css';

const AmenitiesPopup = ({ onClose }) => {
  return (
    <div className="amenities-popup">
      <div className="popup-content">
        <h2>Extra Amenities</h2>
        <p>Add more luxury and comfort to your special day with our extra amenities:</p>
        <ul>
          <li>Private chef services</li>
          <li>Exclusive beach access</li>
          <li>Spa and wellness packages</li>
          <li>Personalized event planning</li>
          <li>And much more...</li>
        </ul>
        <button className="close-button" onClick={onClose}>Close</button>
      </div>
    </div>
  );
};

export default AmenitiesPopup;
